// import { Grid, Text } from '@mantine/core'
import React from 'react'
import {
    Flex,
    Stack,
    Text,
    ActionIcon,
    Slider,
    ColorPicker,
  } from "@mantine/core";

  
const Navbar = () => {
  return (
    <Stack bg="gray.3">
      <Flex
        bg="indigo.6"
        style={{
          borderRadius: "5px",
          display: "flex",
          height: "40px",
          alignItems: "center",
          justifyContent: "space-between",
        }}
      >
        <Text
          ml="xs"
          color="white"
          style={{ display: "inline-block", justifyContent: "flex-center" }}
        >
          Drawer Icon
        </Text>
        <div
          style={{
            display: "flex",
            justifyContent: "flex-end",
            marginRight: "1rem",
          }}
        >
          <IconCircleXFilled />
        </div>
      </Flex>
      </Stack>
  )
}

export default Navbar
